    "A Miniature Compressor for In Situ Resource Utilization on Mars Project",nt"tracking_summary":
    {ntt"total": 7,ntt"recent": 0nt},nt"groups": [],nt"relationships_as_subject":
    [],nt"revision_timestamp": "2015-05-07T03:47:45.339086",nt"name": "a-miniature-compressor-for-in-situ-resource-utilization-on-mars-project",nt"isopen":
    true,nt"url": null,nt"notes": "A key objective for NASA's next rover mission
    to Mars is the demonstration of oxygen production from atmospheric carbon dioxide.
     Such a technology demonstration may pave the way for a future sample return mission
    to the Red Planet as well as possibly a future manned mission to Mars.  A necessary
    component in such a demonstration system is a blower or compressor that can deliver
    the necessary carbon dioxide mass flow to a production plant.  Creare proposes the
    development of a multistage radial flow compressor that is capable of compressing
    400 g/hr to a pressure of up 0.1 Bar.  The compressor will be a turbomachine based
    on our space-qualified vacuum pump technology currently operating on the Curiosity
    rover in Gale Crater on Mars.  In Phase I, we propose to design the compressor and
    perform benchtop testing.  In Phase II, we propose to design and build a full-up
    multistage system.",nt"license_title": "U.S. Government Work",nt"extras":
